import React from 'react';
import styles from './index.modle.scss';

class Square extends React.Component {
    render() {
        return (
            <button className={styles.square}>{this.props.children}</button>
        );
    }
}

class Board extends React.Component {
    renderSquare(i) {
        return (
            <Square children={i} />
        );
    }

    render() {
        return (
            <div>
                <div className={styles.status}>{status}</div>
                <div className={styles['board-row']}>
                    {this.renderSquare(0)}
                    {this.renderSquare(1)}
                    {this.renderSquare(2)}
                </div>
                <div className={styles['board-row']}>
                    {this.renderSquare(3)}
                    {this.renderSquare(4)}
                    {this.renderSquare(5)}
                </div>
                <div className={styles['board-row']}>
                    {this.renderSquare(6)}
                    {this.renderSquare(7)}
                    {this.renderSquare(8)}
                </div>
            </div>
        );
    }
}

export class Login extends React.Component {
    render() {
        return (
            <div className={styles.login}>
                <div className={styles['login-board']}><Board /></div>
                <div className={styles['login-info']}></div>
            </div>
        );
    }
}
